#include "Day14.h"

using namespace std;

class Day14
{
public:
	Day14()
	{
	}

	map<char, unsigned long long> charToOccurence;
	map<string, string> Transitions;

	void ProcessStringToSteps(string input, int nSteps)
	{
		if (nSteps <= 0)
		{
			return;
		}

		for (int i = 0; i < input.length() - 1; ++i)
		{
			char firstChar = input[i];
			char secondChar = input[i + 1];

			string transitionStr{ firstChar , secondChar };

			if (Transitions.find(transitionStr) != Transitions.end())
			{
				auto trans = Transitions.find(transitionStr);
				char charToAdd = trans->second[0];

				if (charToOccurence.find(charToAdd) == charToOccurence.end())
				{
					charToOccurence[charToAdd] = 0;
				}

				charToOccurence[charToAdd] += 1;

				string firstString{ firstChar, charToAdd };
				string secondString{ charToAdd, secondChar };
				ProcessStringToSteps(firstString, nSteps - 1);
				ProcessStringToSteps(secondString, nSteps - 1);
			}
		}
	}

	void Run()
	{
		ifstream infile("inputDay14.txt");

		string line;

		//string input = "NNCB";
		string input = "KOKHCCHNKKFHBKVVHNPN";

		string current;

		if (infile.is_open())
		{

			while (getline(infile, line))
			{
				int indexToSplit = line.find('-');

				string first = line.substr(0, indexToSplit-1);
				string second = line.substr(indexToSplit + 3);

				Transitions.insert({ first, second });
			}

		}

		map<string, unsigned long long> StringToOccurences;
		
		for (int i = 0; i < input.length() - 1; ++i)
		{
			char A = input[i];
			char B = input[i + 1];

			string curr{ A,B };
			if (StringToOccurences.find(curr) == StringToOccurences.end())
			{
				StringToOccurences.insert({ curr, 0 });
			}

			if (charToOccurence.find(A) == charToOccurence.end())
			{
				charToOccurence.insert({ A,0 });
			}

			if (charToOccurence.find(B) == charToOccurence.end())
			{
				charToOccurence.insert({ B,0 });
			}

			charToOccurence[A] += 1;

			StringToOccurences[ curr ] += 1;
		}

		if (charToOccurence.find(input[input.length() - 1]) == charToOccurence.end())
		{
			charToOccurence.insert({ input[input.length() - 1],0 });
		}

		charToOccurence[input[input.length() - 1]]++;


		for (int step = 0; step < 40; ++step)
		{
			map<string, unsigned long long> copy;

			for (auto iter = StringToOccurences.begin(); iter != StringToOccurences.end(); ++iter)
			{
				if (iter->second > 0)
				{
					string curr = iter->first;

					if (Transitions.find(curr) != Transitions.end())
					{
						auto trans = Transitions.find(curr);

						string insert = trans->second;

						string first{curr[0],insert[0]};
						string second{ insert[0], curr[1] };


						if (charToOccurence.find(insert[0]) == charToOccurence.end())
						{
							charToOccurence.insert({ insert[0],0 });
						}

						if (copy.find(first) == copy.end())
						{
							copy.insert({first, 0});
						}

						if (copy.find(second) == copy.end())
						{
							copy.insert({ second, 0 });
						}


						charToOccurence[insert[0]] += iter->second;

						copy[first] += iter->second;
						copy[second] += iter->second;
					}
					else
					{
						if (copy.find(iter->first) == copy.end())
						{
							copy.insert({ iter->first, 0 });
						}

						copy[iter->first] += iter->second;
					}
				}
			}

			StringToOccurences = copy;
		}

		//for (auto iter = StringToOccurences.begin(); iter != StringToOccurences.end(); ++iter)
		//{
		//	for (int i = 0; i < iter->first.length(); ++i)
		//	{
		//		char charToAdd = iter->first[i];
		//		if (charToOccurence.find(charToAdd) == charToOccurence.end())
		//		{
		//			charToOccurence[charToAdd] = 0;
		//		}

		//		charToOccurence[charToAdd] += iter->second;
		//	}

		//}

		unsigned long long Min = ULLONG_MAX;
		unsigned long long Max = 0;

		for (auto iter = charToOccurence.begin(); iter != charToOccurence.end(); ++iter)
		{
			if (iter->second < Min)
			{
				Min = iter->second;
			}
			if (iter->second > Max)
			{
				Max = iter->second;
			}
		}

		cout << Max - Min;

	}

};

void RunDay14()
{
	Day14 Day14Obj;
	Day14Obj.Run();
}

